import React from "react";
import { Spinner } from "react-bootstrap";
const style = {
  textAlign: "left",
  fontSize: "2vh"
};

const ListingThumb = props => {
  if (props.loading === true) {
    return (
      <div style={style}>
        {" "}
        <br />
        <Spinner
          animation="border"
          variant="light"
          style={{ width: "10vh", height: "10vh" }}
        />
        <br />{" "}
      </div>
    );
  } else {
    return (
      <div style={style}>
        {props.job.jobTitle}
        <br />
        {props.job.company}
        <br />
        {props.job.jobType}
      </div>
    );
  }
};

export default ListingThumb;
